    console.log('data in fetch', url, method, body)


    let requestOptions = {
        method: 'GET',
        redirect: 'follow'
    };

    fetch("api.openweathermap.org/data/2.5/weather?q=Haifa,il&appid=82d3d463b96e530d4b14b76571e81d3a", requestOptions)
        .then(response => response.text())
        .then(result => console.log(result))
        .catch(error => console.log('error', error));

